    public static class Easter
    {
        /// <summary>
        /// Calculates eastersunday in the current year.
        /// </summary>
        /// <returns>A DateTime initialized to Easter sunday</returns>
        public static DateTime EasterSunday()
        {
            return EasterSunday(DateTime.Now.Year);
        }

        /// <summary>
        /// Calculates Eastersunday in any given year.
        /// </summary>
        /// <param name="year">Any valid year between 1 and 9999.</param>
        /// <returns>A DateTime initialized to Easter sunday in the input year.</returns>
        public static DateTime EasterSunday(int year)
        {
            if (year < 1 || year > 9999) throw new ArgumentOutOfRangeException("year", year, "Must be between 0001 and 9999.");

            int month = 0;

            int day = 0;

            EasterSunday(year, ref month, ref day);



            return new DateTime(year, month, day);

        }

        public static bool IsEasterSunday(DateTime day)
        {
            DateTime easter = EasterSunday(day.Year);

            return easter.Date == day.Date;
        }


        private static void EasterSunday(int year, ref int month, ref int day)
        {

            if (year < 1 || year > 9999) throw new ArgumentOutOfRangeException("year", year, "Must be between 0001 and 9999.");

            int g = year % 19;

            int c = year / 100;

            int h = h = (c - (int)(c / 4) - (int)((8 * c + 13) / 25) + 19 * g + 15) % 30;

            int i = h - (int)(h / 28) * (1 - (int)(h / 28) * (int)(29 / (h + 1)) * (int)((21 - g) / 11));

            day = i - ((year + (int)(year / 4) + i + 2 - c + (int)(c / 4)) % 7) + 28;

            month = 3;

            if (day > 31)
            {

                month++;

                day -= 31;

            }
        }
    }

    public static class Workday
    {
        public static bool IsWeekend(DateTime date)
        {
            return date.DayOfWeek == DayOfWeek.Saturday || date.DayOfWeek == DayOfWeek.Sunday;
        }

        public static bool IsHoliday(DateTime date)
        {
            int day = date.Day;
            int month = date.Month;
            int dayOfYear = date.DayOfYear;

            //Nytårsdag
            if (day == 1 && month == 1)
                return true;

            //Påsken
            DateTime easterSunday = Easter.EasterSunday(date.Year);
            if (dayOfYear == easterSunday.DayOfYear)
                return true;
            DateTime easterThursday = easterSunday.AddDays(-3);
            if (dayOfYear == easterThursday.DayOfYear)
                return true;
            DateTime easterFriday = easterSunday.AddDays(-2);
            if (dayOfYear == easterFriday.DayOfYear)
                return true;
            DateTime easterMonday = easterSunday.AddDays(1);
            if (dayOfYear == easterMonday.DayOfYear)
                return true;

            //Store bededag
            DateTime bededag = easterSunday.AddDays(26);
            if (dayOfYear == bededag.DayOfYear)
                return true;

            //Kristi himmelfartsdag
            DateTime kristiHimmelfart = easterSunday.AddDays(39);
            if (dayOfYear == kristiHimmelfart.DayOfYear)
                return true;

            //Pinse
            DateTime pinsedag = easterSunday.AddDays(49);
            if (dayOfYear == pinsedag.DayOfYear)
                return true;
            if (dayOfYear == pinsedag.DayOfYear + 1)
                return true;

            //Jul
            if (day == 24 && month == 12)
                return true;
            if (day == 25 && month == 12)
                return true;
            if (day == 26 && month == 12)
                return true;

            return false;
        }

        public static bool IsWorkday(DateTime date)
        {
            if (IsWeekend(date))
                return false;
            if (IsHoliday(date))
                return false;

            return true;
        }

        public static DateTime PreviousWorkDay(DateTime date)
        {
            do
            {
                date = date.AddDays(-1);
            }
            while (IsWeekend(date) || IsHoliday(date));

            return date;
        }

        public static DateTime NextWorkDay(DateTime date)
        {
            do
            {
                date = date.AddDays(1);
            }
            while (IsWeekend(date) || IsHoliday(date));

            return date;
        }
    }

