{
    for (int j = 0; j <= str2.Length; j++)
    {
        if (i == 0)
            distance[i, j] = j;
        else if (j == 0)
            distance[i, j] = i;
        else
            distance[i, j] = Math.Min(
                Math.Min(distance[i - 1, j] + 1, distance[i, j - 1] + 1),
                distance[i - 1, j - 1] + (str1[i - 1] == str2[j - 1] ? 0 : 1)
